import React, { useState } from "react";
import axios from 'axios';
import { PageHeader, Tab, Tabs, Thumbnail, Well, Panel, Row, Col, Nav, NavItem } from "react-bootstrap";
import "./profile.css";

export default function Profile(props) {
  const [firstName, setFirstName] = useState("Kevin");
  const [lastName, setLastName] = useState("Kim");
  const [biography, setBiography] = useState("");
  const [college, setCollege] = useState("");
  const [skills, setSkills] = useState("");
  const [picture, setPicture] = useState("/profile.png");
  const [resume, setResume] = useState("");

  return (
    <div className="Profile">

      <PageHeader>Profile</PageHeader>

      <div className="photo">
        <Thumbnail src={picture} />
      </div>

      <Tab.Container id="left-tabs-example" defaultActiveKey="first">
        <Row className="clearfix">
          <Col sm={2}>
            <Nav bsStyle="pills" stacked>
              <NavItem eventKey="first">Tab 1</NavItem>
              <NavItem eventKey="second">Tab 2</NavItem>
            </Nav>
          </Col>
          <Col sm={8}>
            <Tab.Content animation>
              <Tab.Pane eventKey="first">Tab 1 content</Tab.Pane>
              <Tab.Pane eventKey="second">Tab 2 content</Tab.Pane>
            </Tab.Content>
          </Col>
        </Row>
      </Tab.Container>

    </div>
  );
}
